import Logo from './logo.js';

import './newAccountGeneral.css';

function NewAccoutGeneral(){

    return (
        <div>
            <Logo/>
            <h2>일반회원가입</h2>
            <div className="회원가입정보">
                <form>
                <div>
                    아이디
                    <input>빈칸</input>
                </div>
                <div>비밀번호</div>
                <div>이름</div>
                <div>전화번호</div>
                <div>이메일</div>
                </form>
            </div>
        </div>
    );
}

export default NewAccoutGeneral;
